import Link from "next/link";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookSquare, faInstagram } from '@fortawesome/free-brands-svg-icons';
import { faEnvelopeSquare, faMobileAlt } from "@fortawesome/free-solid-svg-icons"

const Footer = () => (
    <div className="footer">
        <div className="footer-content">
            <div className="footer-section about">
                <h1 className="logo-text">photo<span>assistence</span></h1>
                <p>Descripcion de la empresa, un poco mas de espacio para chamuyar. Corto y conciso para entender las cosas.</p>
                <div className="contact">
                    <span><FontAwesomeIcon icon={faMobileAlt} />&nbsp; 3518195169</span>
                    <span><FontAwesomeIcon icon={faEnvelopeSquare} />&nbsp; photoassistence@gmail.com</span>
                </div>
                <div className="socials">
                    <a href="http://www.facebook.com" target="_blank"><FontAwesomeIcon icon={faFacebookSquare} /></a>
                    <a href="http://www.instagram.com" target="_blank"><FontAwesomeIcon icon={faInstagram} /></a>
                </div>
            </div>
            
            <div className="footer-section links">
                <h2>Quick Links</h2>
                <ul>
                    <Link href="/about"><li>Nosotros</li></Link>
                    <Link href="/servicios"><li>Servicios</li></Link>
                    <Link href="/contacto"><li>Contacto</li></Link>
                    <Link href="/terms"><li>Trminos y condiciones</li></Link>
                </ul>

            </div>
            <div className="footer-section contact-form">
                <h2>Sos fotogrfo?</h2>
                <p>Escribir una descripcion para los fotofrafos interesados
                    en trabajar con nosotros. Algo corto y directo.
                    Podria ser algo asi como los requisitos y un link que lleve directo
                    a la pagina correspondiente.
                </p>

            </div>
        </div>
        <div className="footer-bottom">
            &copy; photo-assistence.com | Designed by Wall Group
        </div>
        <style jsx>{`
        @import url('https://fonts.googleapis.com/css?family=Open+Sans&display=swap');
                .footer {
                    position: relative;
                    width: 100%;
                    flex-shrink: 0;
                    font-family: 'Open Sans', sans-serif;
                }
                
                .footer .footer-content {
                    height: 320px;
                    background: #303036;
                    color: #d3d3d3;
                    display: flex;
                    flex: 1 0 auto;
                }
                
                .footer .footer-content .footer-section {
                    flex: 1px;
                    padding: 25px;
                }
                
                .footer .footer-content h1,
                .footer .footer-content h2 {
                    color: white;
                }
                
                .footer .footer-content .about h1 span {
                    color: rgb(219, 7, 112);
                }
                
                .footer .footer-content .about .contact span {
                    display: block;
                    font-size: 1.1em;
                    margin-bottom: 8px;
                }
                
                .footer .footer-content .about .socials a {
                    border: 1px solid gray;
                    width: 45px;
                    height: 35px;
                    padding-top: 5px;
                    margin-right: 5px;
                    text-align: center;
                    display: inline-block;
                    font-size: 1.3em;
                    border-radius: 5px;
                    transition: all .3s;
                }
                
                .footer .footer-content .about .socials a:hover {
                    border: 1px solid white;
                    color: white;
                    transition: all .3s;
                }
                
                .footer .footer-content .links h2,
                .footer .footer-content .links ul{
                    margin-left: 50px;
                }
                
                .footer .footer-content .links ul li {
                    margin-left: -10px;
                    text-decoration:none;
                    color: #d3d3d3;
                    display: block;
                    margin-bottom: 10px;
                    font-size: 1.em;
                    transition: all .3s;
                }
                
                .footer .footer-content .links ul li:hover {
                    color: white;
                    margin-left: 15px;
                    transition: all .3s;
                }
                
                .footer .footer-content .contact-form .contact-input {
                    background: #272727;
                    color: #bebdbd;
                    margin-bottom: 10px;
                    line-height: 1.5rem;
                    padding: .9rem 1.4rem;
                    border: none;
                }
                
                .footer .footer-content .contact-form .contact-input:focus {
                    background: #1a1a1a;   
                }
                
                .btn-big {
                    padding: .7rem 1.3rem;
                    line-height: 1.3rem;
                    color: white;
                    border: 1px solid white;
